import Link from 'next/link';

export default function Footer(){
    return (
        <footer>
            <div className="company-info">
                <h4>Impact</h4>
                <p>123 Madison Ave</p>
                <p>NY, NY</p>
            </div>
            <style jsx>
                {`
                    footer{
                        background-color: var(--secondary-color);
                        height:20vh;
                        width:100%;
                        color: white;
                        margin:0;
                        font-size: .8rem;
                        display: flex;

                    }

                    .company-info{
                        display:flex;
                        flex-direction: column;
                        justify-content: center;
                        align-content: start;
                        padding-left: 1rem;
                    }

                    p, h4 {
                        margin: 0.5rem;
                    }
                `}
            </style>
        </footer>
    )
}
